import ExpenseItems from "./components/ExpenseItems";
function App() {
  const expenses = [
    {title: "type A", amount: "4" ,date:new Date(2023, 8, 17)},
    {title: "type B", amount: "2" ,date:new Date(2023, 8, 17)},
    {title: "type C", amount: "3" ,date:new Date(2023, 8, 17)}
  ]
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItems></ExpenseItems>
    </div>
  );
}

export default App;
